import foto from '../../assets/images/Quiz/Biury_sus_Fotos-01 .png'

function Suscribe() {
    return (
        <div className="suscribe">
            <div className='photo-container'>
                <img className='photo' src={foto}/>
            </div>
        </div>
    )
}

export default Suscribe
